import {Service} from './Service'
export function login(data) {
  return Service({
    url: '/user/login/',
    method: 'post',
    data: data
  })
}
export function register(data) {
  return Service({
    url: '/user/regist/ ',
    method: 'post',
    data
  })
}
export function addNewAndroidPlugin(data) {
  return Service({
    url: '/manager/addAndroidPlguin',
    data: JSON.stringify(data)
  })
}
